import React, { Component } from 'react';
import ExpenseValueInput from './ExpenseForm/ExpenseValueInput';
import ExpenseDescriptionInput from './ExpenseForm/ExpenseDescriptionInput';
import ExpenseCurrencyInput from './ExpenseForm/ExpenseCurrencyInput';
import ExpensePaymentMethodInput from './ExpenseForm/ExpensePaymentMethodInput';
import ExpenseTag from './ExpenseForm/ExpenseTag';

class WalletExpenseForm extends Component {
  render() {
    return (
      <form>
        <ExpenseValueInput />
        <ExpenseDescriptionInput />
        <ExpenseCurrencyInput />
        <ExpensePaymentMethodInput />
        <ExpenseTag />
      </form>
    );
  }
}

export default WalletExpenseForm;
